	    // console.log("stringSeconds seconds", seconds, "fps", fps, "duration", duration)
	    if (duration >= time) {
	        if (seconds >= time) {
	            bits.push(String(Math.floor(seconds / time)).padStart(pad, '0'));
	            do_rest = true;
	            seconds = seconds % time;
	        }
	        else
	            bits.push('00:');
	    }
